// import {useState} from 'react'
import {useNavigate} from 'react-router-dom'
import "./register.css";
import Button from "@material-ui/core/Button";
import style from "../../components/atoms/Button/buttonsStyles";

const Register = () => {
  let navigate = useNavigate()
  // const defaultUser = useState({
  //     usuario: 'usuarioPrueba1',
  //     clave: '123456'
  // })

  return (
    <>
      <div className="container-register container-fluid d-flex flex-column row">

        <Button
          className="button btn-login my-4"
          variant="contained"
          style={style}
        >
          join now
        </Button>
        <Button
          className="button btn-login my-4"
          variant="contained"
          style={style}
          onClick={() => {navigate('/home')}}
        >
          Ir a inicio
        </Button>
      </div>
    </>
  );
};

export default Register;
